const Footer = () => {
  const pages = [
    { page: "Home", href: '/' },
    { page: "Portfolio", href: "/portfolio" },
    { page: "Contact", href: "contact" }
  ]
  const contactInfo = [
    'bandiavi000@isd284.com',
    '310-362-7663'
  ]
  return (
    <div className='max-w-5xl mx-auto mt-32'>
      <div className='flex justify-between'>
        <div>
          <h1 className='text-slate-gray text-lg'>Pages</h1>
          {
            pages.map((page) => (
              <a href={page.href}>
                <p className='text-black font-montserrat'>{}</p>
              </a>
          ))
          }
        </div>
      </div>
    </div>
  )
}

export default Footer
